import './style/custom.css'
const app = express()

function App() {
  return (
    <div>
      <NavigationBar />
      <Header />
      <RekomendasiProduk />
      <CardKategori />
    </div>
  );
}

app.get('/login', (req, res) => {
  res.render('login.js');
});

export default App;
